import React from "react";

import Planet from "./Planet";
import style from "./PlanetList.module.css";

const PlanetList = (props) => {
  const { planets, currentPageIndex } = props;
  
  if (!props.planets || props.planets.length === 0) {
    return <p>No planets to display.</p>; // Add a message for when there are no planets
  }

  return (
    <ul className={style["planets-list"]}>
      {props.planets.map((planets) => (
        <Planet
        key={planets.id}
          id={planets.id}
          imageSrc={planets.imageSrc} // Pass the imageSrc property
          description={planets.description}
          climate={planets.climate}
          terrain={planets.terrain}
          population={planets.population}
          diameter={planets.diameter}
          gravity={planets.gravity}
          rotationPeriod={planets.rotationPeriod}
          orbitalPeriod={planets.orbitalPeriod}
          surfaceWater={planets.surfaceWater}
          // residents={planets.residents}
          // films={planets.films}
          created={planets.created}
          edited={planets.edited}
          url={planets.url}
        />
      ))}
    </ul>
  );
};

export default PlanetList;
